ese men are like mini-mayors, running a certain section of a city to ensure services and safety for their constituents. Ideally they aren\'t corrupt.'),(161,'Cosmopolitan','Activist',5,'These people believe something strong enough to shout slogans and carry signs. '),(162,'Cosmopolitan','Messenger',5,'While anyone can take a coin to deliver a note, professional messengers are expert horsemen, geographers, diplomats and occasionally expert combatants.'),(163,'Agriculture','Healer',5,'Not all who care for the body are granted powers from above. Most healers are old men and women who have seen their fair share of disease and injury in life.'),(164,'Underworld','Bookie',5,'Where there\'s chance, there\'s gambling. These fine folk keep track of the odds, the winning streaks and the coffers. Where gambling isn\'t legal these tend to be the lowest ranking boss in their local organizations.'),(165,'Shop Keeper','Curiosity ',5,'Displaying either their own malformed body, eerie displays or more likely both, the worker at the curiosity shop is both a pariah, trickster and showman.'),(166,'Shop Keeper','Chandler',5,'A maker and dealer of wax, candles and soaps.'),(167,'Cosmopolitan','Parfumier',5,'A maker of perfumes.'),(168,'Shop Keeper','Confectionary',5,'A maker of sweets and candies. '),(169,'Agriculture','Potter',5,'In smaller locales, a craftsman that makes plates, bowls and cups. In larger areas they can be artists making fine statues and adornments.'),(170,'Craftsman','Glass Blower',5,'Makes glassware of all types, as well as alchemical sets.'),(171,'Cosmopolitan','Money Changer',5,'Buys and Sells forgeign money for local money. In larger communities will also make loans.'),(172,'Agriculture','Wagon Wright',5,'Makes wagons and carts.'),(173,'Shop Keeper','Pawn Broker',5,'Lends money against property, often becomes a used knick-knack shop.'),(174,'Agriculture','Miller',5,'Takes grain and turns it into flour, mash or whatever is needed.'),(175,'Shop Keeper','Book Seller',5,'Buys and sells books and related materials, occassionally will lend books as a library.'),(176,'Shop Keeper','Launderer',5,'Takes dirty clothes and linens, cleans them.'),(177,'Shop Keeper','Clockmaker',5,'Crafts and repairs time keeping devices and other intracte machinery.'),(178,'Service','Barrister',5,'Knows the law and prosecutes or defends it; often serves as an adjudicator or advocate.'),(179,'Cosmopolitan','Bussiness Agent',5,'Conducts business on others behalf, often serving as a relationship maker or for espionage.'),(180,'Cosmopolitan','Shipper',5,'Buys goods low, moves them, sells the high, hopefully.  These are the people behind caravans and how rare goods make it to small towns.'),(181,'Agriculture','Street Vendor',5,'Found wherever there is human civilization, these are the peoplpe on the street with what you may need.'),(182,'Shop Keeper','Smoke Vendor',5,'Sells the finest tabaccos, liquors and other high-end usually legal, luxery consumables.'),(183,'Agriculture','Brewer',5,'Makes distilled beverages, tinctures, tonics from grain, fruit and sugar.'),(184,'Cosmopolitan','Glue Maker',5,'Makes glue from animal carcasses and plants.'),(185,'Aquaculture','Ship Builder',5,'A specialized carpenter, makes wood float.'),(186,'Cosmopolitan','Academic',5,'A rare type who likes to expand and spread the collected knowledge of humanity.');
